import React from 'react';
import { Link } from 'react-router-dom';
import './AdminDashboard.css';
import './CustomerDashboard.css';

const CustomerDashboard = () => {
    return (
        <div className="admin-dashboard">
            <aside className="cust-sidebar">
            </aside>
            <aside className="cust-sidebar-2">
            </aside>
            <aside className="cust-sidebar-3">
            </aside>

            <div className="main-content">
                    <h1>MyClaims Hub</h1>
                <div className="functions">
                    <div className="function-card">
                        <Link to="/userclaim" className="btn">
                        <h3>Submit Claims</h3>
                        <p></p>
                        </Link>
                    </div>
                    <div className="function-card">

                        <Link to="/policylist" className="btn"><h3>Enroll Policy</h3><p></p></Link>
                    </div>
                    <div className="function-card">

                        <Link to="/user" className="btn"><h3>View Claims</h3><p></p></Link>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default CustomerDashboard;
